const projectReducer = (state = {projects:[]}, action) => {
  switch (action.type) {
    case "FETCH_REQUEST":
      return state;
    case "FETCH_SUCCESS": 
      return {...state.projects, posts: action.payload};
    default:
      return state;
  }
} 

export default {
  projectReducer
}
